import React from "react";
import "../Recipe/Recipe.css";

const PurchaseList = (props) => {

  const {ingredientList, setIngredientList, ingredient, setIngredient } = props;

  return (
    <>
      {ingredientList?.map((ingredient, index) => {
        return (
          <div key={index}>
            <div className="flex-container input-field-col">
              <div className="name-field name-position">{ingredient.name}</div>
              <div>
                <div>{`$ ${ingredient.price} per`}</div>
              </div>
              <div>
                <div>{`$ ${ingredient.amount} oz`}</div>
              </div>
            </div>
            <hr />
          </div>
        )
      })}
    </>
  )
}

export default PurchaseList;
